import App, { Container } from 'next/app';
import 'antd/dist/antd.css';
import '../static/style/pages/comm.css';

class MyApp extends App {
    render() {
      const {
        Component, pageProps, mobxStore, router
      } = this.props;
      return (
        <Container>
          {/* {typeof window != 'undefined' && process.env.WITH_TRACKER && <Tracker />} */}
          {/* {typeof window != 'undefined' &&
              <External userInfo={mobxStore.headerStore.headerInfo &&
              mobxStore.headerStore.headerInfo.userInfo}/>}
          */}
          <NextSeo config={SEO} />
          <Provider {...mobxStore}>
            <Layout router={router}>
              <Component {...pageProps} />
            </Layout>
          </Provider>
          <Loading />
        </Container>
      );
    }
  }

export default MyApp
